const Home = () => {
  return(
    <>


      <section>
        <h2 className="section-title">Restaurantes</h2>
        <div className="resturants-list">
          <CardRestaurant />
          <CardRestaurant />
          <CardRestaurant />
        </div>
      </section>
    </>
  )
}

export default Home;
